import React, { Component } from 'react';
import Nav from './components/Nav'
import NotFound from '/components/NotFound'
import './index.css';

import {
  BrowserRouter,
  Route
} from 'react-router-dom';

import apiKey from './config'

class App extends Component {

  constructor() {
    super();
    this.state = {
      photos: []
    };
  }

  componentDidMount() {

  }

  render() {
    return (
    <BrowserRouter>
      <div class="container">
        <Route path="/waterfalls" component={Nav}/>
        <Route path="/dogs" component={Nav}/>
        <Route path="/desert" component={Nav}/>
        </div>
    </BrowserRouter>
  );
}
}

export default App;
